app_version: 1.0.0
name: DingTalk 
description: A DingTalk WebHook API integration.
contact_info:
  name: "@Medicean"
  url: https://github.com/Medicean
  email: medici.yan@gmail.com
tags:
  - Alert
categories:
  - Communication
authentication:
  required: true
  parameters:
    - name: access_token
      description: The  consumer key to use
      example: "*****"
      required: true
      schema:
        type: string
    - name: access_token_secret
      description: The access token secret to use
      example: "*****"
      required: true
      schema:
        type: string
actions:
  - name: send_text
    description: Send a text with Shuffle
    parameters:
      - name: message
        description: The mssage to send. Max 280 characters
        required: true
        multiline: true
        example: 'This is a text message'
        schema:
          type: string
    returns:
      schema:
        type: string
  - name: send_markdown
    description: Send a markdown with Shuffle
    parameters:
      - name: title
        description: The mssage title to send.
        required: true
        multiline: false
        example: 'Hello Shuffle'
        schema:
          type: string
      - name: message
        description: The mssage to send. Max 280 characters
        required: true
        multiline: true
        example: "> Hello Shuffle.\nLearn [More](https://shuffler.io)"
        schema:
          type: string
    returns:
      schema:
        type: string

